pragma solidity ^0.8.0;

import "@openzeppelin/contracts/access/AccessControlEnumerable.sol";
import "@openzeppelin/contracts/security/Pausable.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC721/IERC721.sol";
import "@openzeppelin/contracts/utils/Counters.sol";

contract LemonadeMarketplace is AccessControlEnumerable, Pausable {
    using Counters for Counters.Counter;

    bytes32 public constant PAUSER_ROLE = keccak256("PAUSER_ROLE");

    Counters.Counter private _offerIdTracker;

    event OfferCreated(uint256 indexed offerId, address indexed seller, address currency, uint256 price, address tokenContract, uint256 tokenId);
    event OfferAccepted(uint256 indexed offerId, address indexed buyer);
    event OfferWithdrawn(uint256 indexed offerId);

    struct Offer {
        bool active;
        address seller;
        address currency;
        uint256 price;
        address tokenContract;
        uint256 tokenId;
        address buyer;
    }
    mapping (uint256 => Offer) private _offers;

    constructor() {
        _setupRole(DEFAULT_ADMIN_ROLE, _msgSender());

        _setupRole(PAUSER_ROLE, _msgSender());
    }

    function getOffer(uint256 offerId)
        public
        virtual
        view
        returns(bool, address, address, uint256, address, uint256, address)
    {
        Offer memory offer = _offers[offerId];

        return (offer.active, offer.seller, offer.currency, offer.price, offer.tokenContract, offer.tokenId, offer.buyer);
    }

    function createOffer(address currency, uint256 price, address tokenContract, uint256 tokenId)
        public
        virtual
        whenNotPaused
    {
        IERC721(tokenContract).transferFrom(_msgSender(), address(this), tokenId);

        uint256 offerId = _offerIdTracker.current();

        _offers[offerId] = Offer({
            active: true,
            seller: _msgSender(),
            currency: currency,
            price: price,
            tokenContract: tokenContract,
            tokenId: tokenId,
            buyer: address(0)
        });
        emit OfferCreated(offerId, _msgSender(), currency, price, tokenContract, tokenId);

        _offerIdTracker.increment();
    }

    function withdrawOffer(uint256 offerId)
        public
        virtual
        whenNotPaused
    {
        Offer memory offer = _offers[offerId];
        require(offer.seller == _msgSender() || hasRole(DEFAULT_ADMIN_ROLE, _msgSender()), "LemonadeMarketplace: must be seller to withdraw");
        require(offer.active, "LemonadeMarketplace: offer must be open to withdraw");

        IERC721(offer.tokenContract).transferFrom(address(this), offer.seller, offer.tokenId);

        _offers[offerId].active = false;
        emit OfferWithdrawn(offerId);
    }


    /**
     * @dev Accepts an offer. Must have approved this contract to transfer the
     * amount of currency specified to the seller. Transfers ownership of the
     * item to the filler.
     */
    function acceptOffer(uint256 offerId)
        public
        virtual
        whenNotPaused
    {
        Offer memory offer = _offers[offerId];
        require(offer.active, "LemonadeMarketplace: offer must be open to accept");

        IERC20(offer.currency).transferFrom(_msgSender(), offer.seller, offer.price);
        IERC721(offer.tokenContract).transferFrom(address(this), _msgSender(), offer.tokenId);

        _offers[offerId].active = false;
        _offers[offerId].buyer = _msgSender();
        emit OfferAccepted(offerId, _msgSender());
    }

    function pause()
        public
        virtual
    {
        require(hasRole(PAUSER_ROLE, _msgSender()), "LemonadeMarketplace: must have pauser role to pause");
        _pause();
    }

    function unpause()
        public
        virtual
    {
        require(hasRole(PAUSER_ROLE, _msgSender()), "LemonadeMarketplace: must have pauser role to unpause");
        _unpause();
    }
}

